Information
------------------------------

The Plane That Saved Britain
Channel 4 Paralympics presenter, former Royal Marines Commando and qualified pilot Arthur Williams presents this love letter to the World War II aeroplane he believes history has unjustly forgotten. While the names Spitfire, Lancaster and Hurricane have passed into legend, the De Havilland Mosquito languishes in relative obscurity. But for Arthur, the 'Wooden Wonder' is the plane that saved Britain. In this documentary, he meets the men who flew it, tells its extraordinary story and - 17 years after a fatal crash destroyed the last one to fly - travels to Virginia Beach in the USA to see if he can take to the skies in the world's only remaining flying Mosquito.

